import React, { useState, useEffect } from 'react';

function Dashboard() {
  const [modelInfo, setModelInfo] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetch('http://localhost:5000/api/model-info')
      .then(response => response.json())
      .then(data => {
        setModelInfo(data);
        setLoading(false);
      })
      .catch(err => {
        setError('Failed to fetch model information');
        setLoading(false);
      });
  }, []);

  if (loading) return <div className="text-center">Loading...</div>;
  if (error) return <div className="text-red-500 text-center">{error}</div>;

  return (
    <div className="space-y-6">
      <h1 className="text-3xl font-bold">Dashboard</h1>
      <div className="bg-white p-6 rounded-lg shadow">
        <h2 className="text-xl font-semibold mb-4">Model Status</h2>
        {modelInfo?.model_exists ? (
          <div className="space-y-2">
            <p>Model Type: {modelInfo.model_type}</p>
            <p>Last Modified: {new Date(modelInfo.last_modified).toLocaleString()}</p>
          </div>
        ) : (
          <p className="text-yellow-600">No trained model found. Please train a model first.</p>
        )}
      </div>
    </div>
  );
}

export default Dashboard;
